complete\": \"tony_wills\", \"login_exact\": \"tony_wills\", \"name\": \"Tony Wills\", \"name_autocomplete\": \"Tony Wills\", \"orcid\": null, \"icon\": \"https://static.inaturalist.org/attachments/users/icons/16490/thumb.gif?1475536073\", \"observations_count\": 12550, \"identifications_count\": 65334, \"journal_posts_count\": 8, \"activity_count\": 77892, \"species_count\": 1617, \"annotated_observations_count\": 13919, \"universal_search_rank\": 12550, \"roles\": [\"curator\"], \"site_id\": 3, \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/16490/medium.gif?1475536073\"}, \"created_at\": \"2015-02-22T07:35:00+00:00\", \"created_at_details\": {\"date\": \"2015-02-22\", \"day\": 22, \"month\": 2, \"year\": 2015, \"hour\": 7, \"week\": 8}, \"body\": \"Thanks Lek.  The photos on your observation are a lot clearer.  Now I see what the flys on the surface are doing \\\"The male mosquito usually emerges from the pupal stage noticeably earlier than the female.  They wait on the surface of the rock pool and using the long claws on its fore legs grab onto a pupa which is rising to the surface to emerge.  The male then attempts to mate with the pupa as it is freeing itself from the pupal casing.\\\"\\\"\", \"flags\": [], \"moderator_actions\": [], \"hidden\": false}, {\"id\": 244695, \"uuid\": \"2d724147-a102-46da-9280-154e0daec868\", \"user\": {\"id\": 59123, \"login\": \"lek\", \"spam\": false, \"suspended\": false, \"created_at\": \"2014-06-19T07:17:05+00:00\", \"login_autocomplete\": \"lek\", \"login_exact\": \"lek\", \"name\": \"Lek Khauv\", \"name_autocomplete\": \"Lek Khauv\", \"orcid\": null, \"icon\": \"https://static.inaturalist.org/attachments/users/icons/59123/thumb.gif?1475588572\", \"observations_count\": 4424, \"identifications_count\": 30916, \"journal_posts_count\": 0, \"activity_count\": 35340, \"species_count\": 1934, \"annotated_observations_count\": 1060, \"universal_search_rank\": 4424, \"roles\": [], \"site_id\": 9, \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/59123/medium.gif?1475588572\"}, \"created_at\": \"2015-02-22T15:06:47+00:00\", \"created_at_details\": {\"date\": \"2015-02-22\", \"day\": 22, \"month\": 2, \"year\": 2015, \"hour\": 15, \"week\": 8}, \"body\": \"Who would\'ve known eh? That is one interesting mosquito!\", \"flags\": [], \"moderator_actions\": [], \"hidden\": false}], \"time_zone_offset\": \"+12:00\", \"uri\": \"http://naturewatch.org.nz/observations/1186981\", \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/16490/medium.gif?1475536073\", \"sounds\": []}', 'Saltpool Mosquito', 'Insecta', NULL, NULL, NULL, NULL, NULL, 'iNaturalist', 'Sensor', 'https://www.inaturalist.org/pages/help', '1', 'Human expert validation', '1', 'research', 'Species occurrence', 'Whether a species is observed at a location', 'https://www.sciencedirect.com/topics/earth-and-planetary-sciences/species-occurrence', 'bbbeec5b-9843-4004-93f0-77e28f4dc164', 'Observation take by mobile phone of user: bbbeec5b-9843-4004-93f0-77e28f4dc164', 'NC', 'Anonymous location', 'location.name', 'GeoJSON Point', '-41.345863', '174.789033', 'sensor.name', 'sensor.description', 'location.name', 'location.description', 'GeoJSON Point', 'latitude, longitude', 'FeatureCollection', '[174.7890333333,-41.3458633333]', '2025-10-27', '174.789033', '-41.345863', NULL),
