nded\": false, \"created_at\": \"2013-06-16T03:37:46+00:00\", \"login_autocomplete\": \"steve_kerr\", \"login_exact\": \"steve_kerr\", \"name\": \"Steve Kerr\", \"name_autocomplete\": \"Steve Kerr\", \"orcid\": null, \"icon\": \"https://static.inaturalist.org/attachments/users/icons/58307/thumb.jpg?1578169866\", \"observations_count\": 6813, \"identifications_count\": 62056, \"journal_posts_count\": 0, \"activity_count\": 68869, \"species_count\": 2079, \"annotated_observations_count\": 576, \"universal_search_rank\": 6813, \"roles\": [\"curator\"], \"site_id\": 3, \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/58307/medium.jpg?1578169866\"}, \"created_at\": \"2015-01-07T01:49:15+00:00\", \"created_at_details\": {\"date\": \"2015-01-07\", \"day\": 7, \"month\": 1, \"year\": 2015, \"hour\": 1, \"week\": 2}, \"body\": \"Hi Pete, I wondered that as well, but I\'ve never seen a mosquito down here in Dunedin.  If they\'re here, they must not be the biting kind (and being from North Carolina, I should know!).  Anything related ?\", \"flags\": [], \"moderator_actions\": [], \"hidden\": false}, {\"id\": 225148, \"uuid\": \"bae12051-8988-4ca3-863d-964a0c43e4bc\", \"user\": {\"id\": 57775, \"login\": \"petemcgregor\", \"spam\": false, \"suspended\": false, \"created_at\": \"2012-12-16T00:10:34+00:00\", \"login_autocomplete\": \"petemcgregor\", \"login_exact\": \"petemcgregor\", \"name\": \"Pete McGregor\", \"name_autocomplete\": \"Pete McGregor\", \"orcid\": null, \"icon\": \"https://static.inaturalist.org/attachments/users/icons/57775/thumb.jpg?1607026880\", \"observations_count\": 1369, \"identifications_count\": 379, \"journal_posts_count\": 0, \"activity_count\": 1748, \"species_count\": 545, \"annotated_observations_count\": 319, \"universal_search_rank\": 1369, \"roles\": [], \"site_id\": 3, \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/57775/medium.jpg?1607026880\"}, \"created_at\": \"2015-01-07T02:17:16+00:00\", \"created_at_details\": {\"date\": \"2015-01-07\", \"day\": 7, \"month\": 1, \"year\": 2015, \"hour\": 2, \"week\": 2}, \"body\": \"Hi Steve. As far as I know, nothing other than mosquitoes look like these. Identifying the larvae to species requires a close inspection of the hairs on the breathing siphon, so it\'s probably not possible from photographs (unless you have endless patience and the inclination to fiddle around with getting the right light on submerged specimens. A shallow white tray might work?).  \", \"flags\": [], \"moderator_actions\": [], \"hidden\": false}, {\"id\": 225164, \"uuid\": \"d9fa1602-f640-4106-98b9-beb0263c173c\", \"user\": {\"id\": 58307, \"login\": \"steve_kerr\", \"spam\": false, \"suspended\": false, \"created_at\": \"2013-06-16T03:37:46+00:00\", \"login_autocomplete\": \"steve_kerr\", \"login_exact\": \"steve_kerr\", \"name\": \"Steve Kerr\", \"name_autocomplete\": \"Steve Kerr\", \"orcid\": null, \"icon\": \"https://static.inaturalist.org/attachments/users/icons/58307/thumb.jpg?1578169866\", \"observations_count\": 6813, \"identifications_count\": 62056, \"journal_posts_count\": 0, \"activity_count\": 68869, \"species_count\": 2079, \"annotated_observations_count\": 576, \"universal_search_rank\": 6813, \"roles\": [\"curator\"], \"site_id\": 3, \"icon_url\": \"https://static.inaturalist.org/attachments/users/icons/58307/medium.jpg?1578169866\"}, \"created_at\": \"2015-01-07T03:08:38+00:00\", \"created_at_details\": {\"date\": \"2015-01-07\", \"day\": 7, \"month\": 1, \"year\": 2015, \"hour\": 3, \"week\": 2}, \"body\": \"Done (three additional shots).  I found the Snell paper (thanks) .... will see what arises!\", \"flags\": [], \"moderator_actions\": [], \"hidden\": false}, {\"id\": 9216994, \"uuid\": \"9bcca577-52f8-47cb-b880-7acc745c0f54\", \"user\": {\"id\": 225754, \"login\": \"ngaro\", \"spam\": false, \"suspended\": false, \"created_at\": \"2016-04-27T06:44:51+00:00\", \"login_autocomplete\": \"ngaro\", \"login_exact\": \"ngaro\", \